import React, {useState} from 'react'
import { Container, Row, Col, Text, Form, FormGroup, Label} from 'reactstrap'
//import { Icon, Input } from 'semantic-ui-react'
import {Link, NavLink} from 'react-router-dom'
//import { Column } from 'ag-grid-community'
import Home from './Home'
import {I18nProvider, LOCALES} from '../i18n';
import translate from '../i18n/translate';


const Step4 = () =>{
    //const[locale, setlocal] = useState(LOCALES.ENGLISH);
    const [locale, setLocal] = useState(LOCALES.ENGLISH);
    return (
        <I18nProvider>
        <Container>
       <h3> {translate('finished')}</h3> <br/>
        <h3>{translate('contact')}</h3>
        <Row>
        <Col>
            <div><li><Link to="/Home">Back To Main Page</Link></li></div>
        </Col>
        </Row>
        <button onClick={()=> setLocal(LOCALES.ENGLISH)}>ENGLISH</button>
        <button onClick={()=> setLocal(LOCALES.CHINESE)}>CHINESE</button>

        </Container>
        </I18nProvider>
    )
}
export default Step4;
